/*!50003 SET sql_mode              = 'ONLY_FULL_GROUP_BY,STRICT_TRANS_TABLES,NO_ZERO_IN_DATE,NO_ZERO_DATE,ERROR_FOR_DIVISION_BY_ZERO,NO_ENGINE_SUBSTITUTION' */ ;
DELIMITER ;;
CREATE  PROCEDURE `insertData`(
	in soluongxe int,
    in soluongtuyen int,
    in soluongchuyen int
)
BEGIN
  DECLARE i INT DEFAULT 1;
  declare idxe BINARY(16);
  declare idghe binary(16);
  declare slghe int default 1;
  declare sltram int default 1;
  
  declare sorecordXe int;
  declare idtram binary(16);
  declare idtinh binary(16);
  declare tentinh varchar(511);
  
  
  declare sltuyen int default 1;
  declare idtuyen binary(16);
  declare idtramdi binary(16);
  declare idtinhdi binary(16);

  declare idtramdung binary(16);
  declare soluongtuyentram int default 1;
  
  
  declare idchuyen binary(16);
  declare ngayxuatphat datetime;
  declare ngayden datetime;
  declare slc int default 1;
  
  set sorecordXe = (select count(*) from vehicles);
  WHILE i <= soluongxe DO
	set idxe  = UUID_TO_BIN(UUID());
    INSERT INTO vehicles
    VALUES (idxe,true, 40, now(),concat("59BH ",RIGHT(sorecordXe, 5), i), 40,'ACTIVE','SEAT', now());
    
    set slghe = 1;
    while slghe <= 40 do
		set idghe = UUID_TO_BIN(UUID());
		insert into seats
		values (idghe, now(), slghe, concat("59BH",RIGHT(sorecordXe, 5), i, slghe), 'ACTIVE', NOW(), idxe);
        
        set  slghe = slghe + 1;
    end while;
    SET i = i + 1;
  END WHILE;
  
  while sltram <= 50 do
	 set idtinh = null;
     set idtram = UUID_TO_BIN(UUID());
		SELECT p.id, p.name
		INTO idtinh, tentinh
		FROM provinces p
			LEFT JOIN stops s ON s.province_id = p.id
		WHERE s.id IS NULL
		ORDER BY RAND()
		LIMIT 1;
	if idtinh is not null
    then
		insert into stops
		values (idtram, 1, concat("số ", sltram, " " , tentinh), 1, 1, now(), 1, concat("Bến xe ", tentinh), now(), idtinh, null);
    end if;
  set sltram = sltram + 1;
  end while;
  
  -- thêm tuyến và trạm thuộc tuyến
  set soluongtuyentram = 1;
  while sltuyen <= soluongtuyen do
	set idtuyen = UUID_TO_BIN(UUID());
   SELECT id, province_id
    into idtramdi, idtinhdi
	FROM stops
	ORDER BY RAND()
	LIMIT 1;
                    
	set idtramdung = (SELECT id
				FROM stops
                where id <> idtinhdi
				ORDER BY RAND()
				LIMIT 1);
    insert into routes
    values (idtuyen, 1, concat(sorecordXe, sltuyen), now(), (SELECT FLOOR(RAND()*2000)), (SELECT FLOOR(RAND() * (900 - 100 + 1)) + 100),  concat("Tuyến ", concat(sorecordXe, sltuyen)), now(), idtramdi,idtramdung  );
    
    while soluongtuyentram < (SELECT FLOOR(RAND() * (20 - 3 + 1)) + 3) do
			SELECT s.id, s.province_id
			INTO idtramdi, idtinhdi
			FROM stops s
			LEFT JOIN route_stops st
			  ON st.route_id = idtuyen
			 AND st.stop_id  = s.id
			WHERE st.stop_id IS NULL         
			ORDER BY RAND()
			LIMIT 1;

		insert into route_stops
        values(1,1,1,now(),1,soluongtuyentram,now(),idtuyen, idtramdi );
        
    set soluongtuyentram = soluongtuyentram + 1;
    end while;
  set sltuyen = sltuyen + 1;
  end while;
  
  while slc <= soluongchuyen do
		set ngayxuatphat = (SELECT DATE_ADD(NOW(), INTERVAL (SELECT FLOOR(RAND() * (15 - 1 + 1)) + 1) DAY));
        
        set ngayden = (SELECT DATE_ADD(ngayxuatphat, INTERVAL (SELECT FLOOR(RAND() * (15 - 1 + 1)) + 1) DAY));
        
		SET idxe = (
		  SELECT v.id
		  FROM vehicles v
		  LEFT JOIN trips t
			ON t.vehicle_id = v.id
		   AND t.scheduled_departure_time < ngayden
		   AND t.scheduled_arrival_time   > ngayxuatphat
		  WHERE t.vehicle_id IS NULL          -- không có trip nào overlap
		  ORDER BY RAND()
		  LIMIT 1
		);
		set idtuyen = (select id from routes order by rand() limit 1);
        if idxe is not null
        then
			set idchuyen = UUID_TO_BIN(UUID());
			insert into trips
            values (idchuyen, null, null, now(), UUID_TO_BIN(UUID()), '', (SELECT FLOOR(RAND() * (900000 - 200000 + 1)) + 200000), ngayxuatphat, ngayden, 'SCHEDULED', now(), idtuyen, idxe);
        end if;
  set slc = slc + 1;
  end while;
END ;;
DELIMITER ;
