DELIMITER ;;
CREATE  PROCEDURE `muave`(
slnguoimua int
)
BEGIN
declare mua int default 1;
declare huy int default 1;
declare slve int;
declare ve int;
declare giave decimal(10,2);
declare idbooking binary(16);
declare idchuyen binary(16);        
declare idtuyen binary(16);
declare stttramdi int;
declare stttramden int;
declare idtramdi binary(16);
declare idtramdung binary(16);
declare idghe binary(16);
while mua <= slnguoimua do
set idbooking = UUID_TO_BIN(UUID());
set slve = (SELECT FLOOR(RAND() * (5 - 1 + 1)) + 1);
set idchuyen = null;
set idchuyen = (select s.id
				from trips s
					left join bookings b on b.trip_id = s.id
				where b.id is null
                order by rand()
                limit 1);
if idchuyen is null
then
set idchuyen = (select id
				from trips
                order by rand()
                limit 1);
end if;

	select price, route_id
    into giave, idtuyen
	from trips
	where id = idchuyen;
	
    set idtramdung = (select stop_id
					  from route_stops 
                      where route_id = idtuyen and stop_order <= 4
                      order by rand()
                      limit 1);
                      
	set idtramdi = (select stop_id
					  from route_stops 
                      where route_id = idtuyen and stop_order >=5
                      order by rand()
                      limit 1);
insert into bookings
values (idbooking, CONCAT('BK', LPAD(FLOOR(RAND()*1000000), 6, '0')),CONCAT('user', FLOOR(RAND()*100000), '@gmail.com')
	  ,	ELT(1 + FLOOR(RAND()*10),
      'Nguyen Van A', 'Tran Thi B', 'Le Van C', 'Pham Thi D', 'Do Van E',
      'Hoang Thi F', 'Dang Van G', 'Bui Thi H', 'Vu Van I', 'Ngo Thi K')
      , CONCAT('0', FLOOR(100000000 + RAND()*900000000))
      , null
      , null
      , now()
      , UUID_TO_BIN(UUID())
      , ELT(1 + FLOOR(RAND()*4), 'BANK_TRANSFER', 'CARD', 'CASH', 'ONLINE') 
      , ELT(1 + FLOOR(RAND()*3), 'PAID', 'REFUNDED', 'UNPAID')
      , slve
      , UUID_TO_BIN(UUID())
      , ELT(1 + FLOOR(RAND()*4), 'COMPLETED','CONFIRMED','PAID','PENDING')
      , slve * giave
      , now()
      , idtramdi
      , idtramdung
      , idchuyen);
set ve = 1;	
	while ve <= slve
	do
		set idghe = null;
		set idghe = (select s.id
					 from trips t 
					 inner join routes r on r.id = t.route_id
					 inner join vehicles v on v.id = t.vehicle_id
					 inner join seats s on s.vehicle_id = v.id
					 left join bookings b on b.trip_id = t.id
					 left join booking_details bk on bk.booking_id = b.id and s.id = bk.seat_id
					 where t.id = idchuyen
							and bk.id is null
					limit 1);
		insert into booking_details
		values(UUID_TO_BIN(UUID()), now(), null, null, giave,ELT(1 + FLOOR(RAND()*3), 'BOOKED','CHECKED_IN','USED'), idbooking, idghe);
	set ve = ve + 1;
	end while;
set mua = mua + 1;
end while;
END ;;
